import React from 'react';
import { Routes, Route, useLocation } from 'react-router-dom';
import { Box, CssBaseline } from '@mui/material';
import AppBar from './components/AppBar';
import Sidebar from './components/SideMenu';
import TransferCertificate from './Forms/TransferCertificate';

import Paragraph1 from './Forms/BscNursingForms/BscNursing2Year';
import Paragraph2 from './Forms/BscNursingForms/BscNursing3Year';
import Paragraph3 from './Forms/BscNursingForms/BscNursing4Year';
import BPT1Semester from './Forms/BPT Forms/BPT1Semester';
import BPT2Semester from './Forms/BPT Forms/BPT2Semester';
import NursingSemester1 from './Forms/BscNursing4YDCForms/NursingSemester1';
import Paragraph7 from './Forms/BscNursing4YDCForms/NursingSemester3';
import BPT3Semester from './Forms/BPT Forms/BPT3Semester';
import BPT4Semester from './Forms/BPT Forms/BPT4Semester';
import BPT5Semester from './Forms/BPT Forms/BPT5Semester';
import BPT6Semester from './Forms/BPT Forms/BPT6Semester';
import BPT7Semester from './Forms/BPT Forms/BPT7Semester';
import BPT8Semester from './Forms/BPT Forms/BPT8Semester';
import NursingSemester4 from './Forms/BscNursing4YDCForms/NursingSemester4';
import AnesthesiaFirstYear from './Forms/BscAnesthesiaForms/AnesthesiaFirstYear';
import MLTSecondYear from './Forms/BscAnesthesiaForms/MLTSecondYear';
import MLTThirdYear from './Forms/BscAnesthesiaForms/MLTThirdYear';
import AnesthesiaSecondYear from './Forms/BscAnesthesiaForms/AnesthesiaSecondYear';
import AnesthesiaThirdYear from './Forms/BscAnesthesiaForms/AnesthesiaThirdYear';
import HMCFirstYearSemester1 from './Forms/HospitalMangementCourseForms/HMCFirstYearSemester1';
import HMCFirstYearSemester2 from './Forms/HospitalMangementCourseForms/HMCFirstYearSemester2';
import HMCSecondYearSemester3 from './Forms/HospitalMangementCourseForms/HMCSecondYearSemester3';
import HMCSecondYearSemester4 from './Forms/HospitalMangementCourseForms/HMCSecondYearSemester4';


const App = () => {
  const location = useLocation();

  return (
    <Box sx={{ display: 'flex' }}>
      <CssBaseline />
      <AppBar/>
      <Sidebar />

      <Box
        component="main"
        sx={{
          flexGrow: 1,
          padding: 3,
          height: '100vh',
          overflowY: 'auto',
        }}
      >
        <Routes location={location}>
          <Route path="/" element={<TransferCertificate />} />
          <Route path="/para1" element={<Paragraph1/>} />
          <Route path="/para2" element={<Paragraph2/>} />
          <Route path="/para3" element={<Paragraph3/>} />
          <Route path="/para4" element={<BPT1Semester/>} />
          <Route path="/para5" element={<BPT2Semester/>} />
          <Route path="/para6" element={<NursingSemester1/>} />
          <Route path="/para7" element={<Paragraph7/>} />
          <Route path="/para8" element={<BPT3Semester/>} />
          <Route path="/para9" element={<BPT4Semester/>} />
          <Route path="/para10" element={<BPT5Semester/>} />
          <Route path="/para11" element={<BPT6Semester/>} />
          <Route path="/para12" element={<BPT7Semester/>} />
          <Route path="/para13" element={<BPT8Semester/>} />
          <Route path="/para14" element={<NursingSemester4/>} />
          <Route path="/para15" element={<AnesthesiaFirstYear/>} />
          <Route path="/para17" element={<AnesthesiaSecondYear/>} />
          <Route path="/para16" element={<MLTSecondYear/>} />
          <Route path="/para18" element={<AnesthesiaThirdYear/>} />
          <Route path="/para19" element={<MLTThirdYear/>} />
          <Route path="/para20" element={<HMCFirstYearSemester1/>} />
          <Route path="/para21" element={<HMCFirstYearSemester2/>} />
          <Route path="/para22" element={<HMCSecondYearSemester3/>} />
          <Route path="/para23" element={<HMCSecondYearSemester4/>} />



        </Routes>
      </Box>
    </Box>
  );
};

export default App;
